import React, { createContext, useContext, useState, useEffect } from 'react';
import styled, { keyframes } from 'styled-components'; 

const TouchContext = createContext();
const rotate360 = keyframes`
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
`;

export const useTouchContext = () => useContext(TouchContext);

const ImageContainer = styled.div`
  position: fixed;
  pointer-events: none;
  z-index: 9999;
  transition: transform 0.1s ease;
  opacity: 1;
  visibility: 1;
  img {
    transform: scale(4);
    animation: ${rotate360} 2s linear infinite;
  }
`;

const TouchProvider = ({ children }) => {
  const [startY, setStartY] = useState(null);
  const [movedY, setMovedY] = useState(0);
  const [cursorPosition, setCursorPosition] = useState({ x: 0, y: 0 });
  const [isVisible, setIsVisible] = useState(false); 
  const [isMobile, setIsMobile] = useState(false); // State để xác định thiết bị là di động

  useEffect(() => {
    // Kiểm tra xem thiết bị có phải là di động hay không
    const mediaQuery = window.matchMedia('(max-width: 768px)');
    setIsMobile(mediaQuery.matches);

    const updatePosition = (e) => {
      setCursorPosition({ x: e.clientX, y: e.clientY });
    };

    // Lắng nghe sự kiện chỉ khi thiết bị không phải là di động
    if (!isMobile) {
      document.addEventListener('mousemove', updatePosition);
      document.addEventListener('touchmove', updatePosition);
    }

    return () => {
      // Hủy lắng nghe khi component unmount
      document.removeEventListener('mousemove', updatePosition);
      document.removeEventListener('touchmove', updatePosition);
    };
  }, [isMobile]);

  const handleTouchStart = (e) => {
    e.preventDefault();
    if (startY === null || isMobile) return; // Chỉ xử lý khi không phải thiết bị di động

    setStartY(e.touches[0].clientY);
    setIsVisible(true); 
  };

  const handleTouchMove = (e) => {
    e.preventDefault();
    if (startY === null || isMobile) return; // Chỉ xử lý khi không phải thiết bị di động

    const currentY = e.touches[0].clientY;
    const diffY = currentY - startY;

    setMovedY(diffY);
  };

  const handleTouchEnd = (e) => {
    e.preventDefault();
    if (isMobile) return; // Chỉ xử lý khi không phải thiết bị di động

    setStartY(null);
    setMovedY(0);
    setIsVisible(false);
  };

  return (
    <TouchContext.Provider
      value={{
        startY,
        movedY,
        handleTouchStart,
        handleTouchMove,
        handleTouchEnd,
        cursorPosition,
      }}
    >
      {children}
      {!isMobile && (
        <ImageContainer isVisible={isVisible} style={{ left: cursorPosition.x - 38, top: cursorPosition.y - 38 }}>
          <img
            src="data:image/png;base64,"
            alt="Cursor"
            style={{ width: '76px', height: 'auto', borderRadius: '50%' }}
          />
        </ImageContainer>
      )}
    </TouchContext.Provider>
  );
};

export { TouchProvider };
